import React from "react";
import { Graph } from "react-d3-graph";

const LineageGraph = ({ data }) => {
  const config = {
    node: {
      color: "lightblue",
      size: 120,
      highlightStrokeColor: "blue",
      labelProperty: "name",
    },
    link: {
      highlightColor: "lightblue",
    },
    directed: true,
    height: 800,
    width: 800,
  };

  const graphData = {
    nodes: data.nodes.map((model) => ({
      id: model.name,
      name: model.name,
    })),
    links: data.dependencies.map((dependency) => ({
      source: dependency.model,
      target: dependency.depends_on,
    })),
  };

  return (
    <div>
      <h2>Lineage Graph</h2>
      <Graph
        id="lineage-graph"
        data={graphData}
        config={config}
      />
    </div>
  );
};

export default LineageGraph;
